

# Count sequences of given length having non-negative prefix sums that can be generated by given values
# https://www.geeksforgeeks.org/count-sequences-of-given-length-having-non-negative-prefix-sums-that-can-be-generated-by-given-values/

def non_negative_prefix_sum(n,dp):
    if n==0 or n==1:
        return 1
    if dp[n]!=-1:
        return dp[n]
    ans=0
    for j in range(n):
        ans+=non_negative_prefix_sum(n-1-j,dp)*non_negative_prefix_sum(j,dp)
    dp[n]=ans
    return ans
m=4
x=5
dp=[-1 for i in range(m//2+1)]
print(non_negative_prefix_sum(m//2,dp))






























